import React from "react";

import { useContext } from "react";
import ApiContext from "../../store/api-contex";
import { useHttp } from "../../hooks/useHttp";

import classes from "./OriginalMov.module.css";

export default function OriginalMov({ ogData }) {
  const imgPath = `https://image.tmdb.org/t/p/original${ogData.poster_path}`;
  return (
    <li className={classes["og"]}>
      <img src={imgPath} alt="" />
    </li>
  );
}
